import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Sidebar from './Sidebar';
import TransferCertificate from './Forms/TransferCertificate';
import Paragraph1 from './Forms/Paragraph1';
import Paragraph2 from './Forms/Paragraph2';
import Paragraph3 from './Forms/Paragraph3';
import Paragraph4 from './Forms/Paragraph4';
import Paragraph5 from './Forms/Paragraph5';
import Paragraph6 from './Forms/Paragraph6';
import Paragraph7 from './Forms/Paragraph7';

const App = () => {
  return (
    <Router>
      <div style={{ display: 'flex' }}>
        <Sidebar />

        <div style={{ flexGrow: 1, padding: '20px' }}>
          <Routes>
            <Route path="/" element={<TransferCertificate />} />
            <Route path="/transfer-certificate" element={<TransferCertificate />} />
            <Route path="/paragraph1" element={<Paragraph1 />} />
            <Route path="/paragraph2" element={<Paragraph2 />} />
            <Route path="/paragraph3" element={<Paragraph3 />} />
            <Route path="/paragraph4" element={<Paragraph4 />} />
            <Route path="/paragraph5" element={<Paragraph5 />} />
            <Route path="/paragraph6" element={<Paragraph6 />} />
            <Route path="/paragraph7" element={<Paragraph7 />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
